import Link from "next/link";

const Index = () => (
  <div>
    <H1>Welcome to BitzPrice!</H1>
    <ul>
      <li>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
    </ul>
  </div>
);
export default Index;
